import React, {Component} from "react";
import NavProd from "./NavProd";
import { Route, Switch } from "react-router-dom";
import Shops1 from "./shops1";
import Shop2 from "./shop2";
import Prod1 from "./prod1";
import Prod2 from "./prod2";
import Purchase from "./purchase";
import Purchase1 from "./purchase1";
class MainProduct extends Component{
    render(){
        return(
            <div className="container">
                <NavProd />
                <Switch>
                <Route path="/products/Add" component={Prod2} /> 
                <Route path="/products/:id/edit" component={Prod2} /> 
                <Route path="/products/View" component={Prod1} />
                <Route path="/totalPurchase/shop/:id" component={Purchase1} /> 
                <Route path="/shops/Add" component={Shop2} />                     
                <Route path="/purchases" component={Purchase} />
                <Route path="/shops/View" component={Shops1} />
                </Switch>
            </div>
        );
    }
}
export default MainProduct;
